import styled from 'styled-components';

export const Container = styled.main`
    width: 100%;
    height: 100vh;
    margin-bottom: 3rem;
    background-color:  #151325;
    
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
`
